def firstUniqChar(s: str) -> int:
        alpha = [-1] * 26
        for i, c in enumerate(s):
            if alpha[ord(c)-ord('a')] > -1:
                alpha[ord(c)-ord('a')] = 100
            else:
                alpha[ord(c)-ord('a')] = i
                
        filtered = list(filter(lambda x: x > -1, alpha))
        print(alpha)
        print(filtered)
        if len(filtered) > 0:
            return min(filtered)
        else:
            return -1


